INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL91019PL', 'Electrónicos y sus Accesorios', 'Gadgets', 'Kit de lentes para smartphone, cuenta con 4 tipos diferentes de lentes. Esto incluye lente de ojo de pez, lente amplia, lente macro y lente CPL (que elimina la luz dispersa y produce una imagen más natural). Simplemente coloque el lente en su teléfono inteligente y gire la base para probar los 4 lentes diferentes.', NULL, NULL, '-', '-', '-', '-', 'PPM');
INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL91021PL', 'Electrónicos y sus Accesorios', 'Gadgets', 'Convierta la cámara de su teléfono inteligente en un telescopio con Zoom 8x. Realice la toma perfecta de larga distancia o una foto de cerca. El clip se adapta a la mayoria de los smarthphones.', 142.52, 142.52, '-', '-', '-', '-', 'PPM');
