INSERT INTO `articulos` (`modelo`, `categoria`, `subcategoria`, `descripcion`, `precio_distribuidor`, `precio_publico`, `largo`, `ancho`, `alto`, `peso`, `catalogo`) VALUES ('EL92009PL', 'Electrónicos y sus Accesorios', 'Gadgets', 'Cámara de accion WiFi equipada con un lente HD 1080P y pantalla LCD de 0.96\" para llevar sus fotografías al siguiente nivel. Transmite vídeo en directo desde el dispositivo conectado a la cámara 360 a través de la aplicación. Capaz de grabar cualquier ángulo en alta resolución con vista panorámica de 360º ?. Transfiera imágenes de forma inalámbrica a su correo electrónico, almacenamiento en la nube o a una red social. Incluye carcasa para el agua para sumergir hasta 30 metros y accesorios para montaje y soporte. Cable micro USB de carga incluído. No incluye tarjeta micro SD.', 2101.75, 2101.75, '7.6', '-', '7.6', '-', 'PPM');
